import Link from 'next/link'

class Menu extends React.Component {
  render() {
    return(
      <ul className="navbar-nav flex-column w-100 text-center">
        <li className="nav-item">
          <Link href="/">Home</Link>
        </li>
      </ul>
    )
  }
}
export default Menu
